// src/components/Home/Home.jsx
import React, { useEffect } from 'react';
import 'swiper/swiper-bundle.min.css'; // Import Swiper styles
import './Home.css'; // Import your CSS file for Home component

const Home = () => {
    useEffect(() => {
        // Import Swiper JS dynamically
        const script = document.createElement('script');
        script.src = 'https://unpkg.com/swiper/swiper-bundle.min.js';
        script.onload = () => {
            // Initialize Swiper after script loads
            const swiper = new Swiper('.mySwiper', {
                effect: 'coverflow',
                grabCursor: true,
                centeredSlides: true,
                slidesPerView: 'auto',
                coverflowEffect: {
                    rotate: 50,
                    stretch: 0,
                    depth: 100,
                    modifier: 1,
                    slideShadows: true,
                },
                pagination: {
                    el: '.swiper-pagination',
                },
            });
        };
        document.body.appendChild(script);

        // Cleanup script on component unmount
        return () => {
            document.body.removeChild(script);
        };
    }, []);

    return (
        <div className="cont1">
            <p>
                <u>E<span>vent</span>Hub</u>
            </p>
            <div className="cont_in" id="home">
                <p>
                    to make moments <span>beautiful...</span>
                </p>
                <div className="swiper mySwiper">
                    <div className="swiper-wrapper">
                        <div className="swiper-slide"><img src={require('../../assets/images/shadi.jpg')} alt="Event 1" /></div>
                        <div className="swiper-slide"><img src={require('../../assets/images/janeu.jpg')} alt="Event 2" /></div>
                        <div className="swiper-slide"><img src={require('../../assets/images/e2.jpeg')} alt="Event 3" /></div>
                        <div className="swiper-slide"><img src={require('../../assets/images/e3.jpeg')} alt="Event 4" /></div>
                        <div className="swiper-slide"><img src={require('../../assets/images/e4.jpeg')} alt="Event 5" /></div>
                        <div className="swiper-slide"><img src={require('../../assets/images/e5.jpeg')} alt="Event 6" /></div>
                    </div>
                    <div className="swiper-pagination"></div>
                </div>
            </div>
        </div>
    );
};

export default Home;
